import { NavLink } from "react-router-dom";

const DUMMY_EVENTS = [
    {
      id: 'e1',
      title: 'Some event',
    },
    {
      id: 'e2',
      title: 'Another event',
    },
  ];

const Events = () => {
    return (
        <>
        {DUMMY_EVENTS.map((event) => (
            <li key={event.id}>
              <NavLink to={event.id}>{event.title}</NavLink>
            </li>
          ))}
        </>
    )
}

export default Events;
